import React from 'react'
import GoogleMapReact from 'google-map-react'
import './GoogleMap.scss'
import LocationPin from './LocationPin';

const Map = ({ location, zoomLevel, className }) => (
  <div className={`google-map ${className}`}>
    <GoogleMapReact
      bootstrapURLKeys={{ key: 'AIzaSyCDQY2Gatxh38awcCqZzSBF-BgwZzV2HVk' }}
      defaultCenter={{
        lat: 59.95,
        lng: 30.33
      }}
      defaultZoom={11}
    >
      <LocationPin
        lat={59.95}
        lng={30.33}
        text='troloroo'
      />
    </GoogleMapReact>
  </div>
)

export default Map;
